import React from "react";

const Home = () => {
    return (
        <html lang="en">
        <head>
            <meta charset="UTF-8"/>
            <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
            <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
        </head>
        <body>
            <nav>
                <div className="wrapper">
                    <div className="logo"></div>
                </div>
            </nav>
        </body>
        </html>
    );
};
export default Home;
